import React from "react";

export default function OrganizationsVers({vers}) {
    return (
        <div className="helpPage-organisation">
            <div className="organisation-description">
                <h4 className="description-title">{vers.name}</h4>
                <p className="description-text">{vers.goal}</p>
            </div>
            <p className="organisation-thingsTogether">{vers.items}</p>
        </div>
    )
}
